(44, 35, 'Habia una vez...', 'Habia+una+vez...', 'Habia una vez un veterano de las fuerzas armadas que sonaba con cantar e inspirar a sus camaradas pero debido a su falta de planificacion jamas lo pudo lograr, murio de un tiro a la cabeza pero no suyo ni siquiera del enemigo sino de su amigo y almirante Cristofer Salas Frias que siempre lo detesto por que temia que lo superara y el fuese desechado como un balon de basourra. Fin', '2019-09-26 17:08:39', 0);
